UPDATE department
SET department_head_id = 
    CASE department_id
        WHEN 1 THEN (SELECT professor_id FROM professor WHERE department_id = 1 LIMIT 1)  -- Кафедра биологии
        WHEN 2 THEN (SELECT professor_id FROM professor WHERE department_id = 2 LIMIT 1)  -- Кафедра экологии
        WHEN 3 THEN (SELECT professor_id FROM professor WHERE department_id = 3 LIMIT 1)  -- Кафедра зоологии
        WHEN 4 THEN (SELECT professor_id FROM professor WHERE department_id = 4 LIMIT 1)  -- Кафедра программирования
        WHEN 5 THEN (SELECT professor_id FROM professor WHERE department_id = 5 LIMIT 1)  -- Кафедра кибербезопасности
        WHEN 6 THEN (SELECT professor_id FROM professor WHERE department_id = 6 LIMIT 1)  -- Кафедра информационных технологий
        WHEN 7 THEN (SELECT professor_id FROM professor WHERE department_id = 7 LIMIT 1)  -- Кафедра истории
        WHEN 8 THEN (SELECT professor_id FROM professor WHERE department_id = 8 LIMIT 1)  -- Кафедра археологии
        WHEN 9 THEN (SELECT professor_id FROM professor WHERE department_id = 9 LIMIT 1)  -- Кафедра культурологии
        WHEN 10 THEN (SELECT professor_id FROM professor WHERE department_id = 10 LIMIT 1) -- Кафедра математики
        WHEN 11 THEN (SELECT professor_id FROM professor WHERE department_id = 11 LIMIT 1) -- Кафедра прикладной математики
        WHEN 12 THEN (SELECT professor_id FROM professor WHERE department_id = 12 LIMIT 1) -- Кафедра статистики
        WHEN 13 THEN (SELECT professor_id FROM professor WHERE department_id = 13 LIMIT 1) -- Кафедра психологии
        WHEN 14 THEN (SELECT professor_id FROM professor WHERE department_id = 14 LIMIT 1) -- Кафедра клинической психологии
        WHEN 15 THEN (SELECT professor_id FROM professor WHERE department_id = 15 LIMIT 1) -- Кафедра социальной психологии
        WHEN 16 THEN (SELECT professor_id FROM professor WHERE department_id = 16 LIMIT 1) -- Кафедра политологии
        WHEN 17 THEN (SELECT professor_id FROM professor WHERE department_id = 17 LIMIT 1) -- Кафедра социологии
        WHEN 18 THEN (SELECT professor_id FROM professor WHERE department_id = 18 LIMIT 1) -- Кафедра социальной работы
        WHEN 19 THEN (SELECT professor_id FROM professor WHERE department_id = 19 LIMIT 1) -- Кафедра филологии
        WHEN 20 THEN (SELECT professor_id FROM professor WHERE department_id = 20 LIMIT 1) -- Кафедра лингвистики
        WHEN 21 THEN (SELECT professor_id FROM professor WHERE department_id = 21 LIMIT 1) -- Кафедра перевода
        WHEN 22 THEN (SELECT professor_id FROM professor WHERE department_id = 22 LIMIT 1) -- Кафедра физики
        WHEN 23 THEN (SELECT professor_id FROM professor WHERE department_id = 23 LIMIT 1) -- Кафедра космической физики
        WHEN 24 THEN (SELECT professor_id FROM professor WHERE department_id = 24 LIMIT 1) -- Кафедра квантовой физики
        WHEN 25 THEN (SELECT professor_id FROM professor WHERE department_id = 25 LIMIT 1) -- Кафедра журналистики
        WHEN 26 THEN (SELECT professor_id FROM professor WHERE department_id = 26 LIMIT 1) -- Кафедра коммуникаций
        WHEN 27 THEN (SELECT professor_id FROM professor WHERE department_id = 27 LIMIT 1) -- Кафедра экономики
        WHEN 28 THEN (SELECT professor_id FROM professor WHERE department_id = 28 LIMIT 1) -- Кафедра финансов
        WHEN 29 THEN (SELECT professor_id FROM professor WHERE department_id = 29 LIMIT 1) -- Кафедра бухгалтерского учета
